import './styles.css';

const mockData = [{
    id: 1,
    status: 0, /* status: 0: not done; 1: done */
    description: 'create landing page',
}]

function List() {
    const listItem = () => {
        return mockData.map((data, idx) => {
            return (
                <div key={idx}>
                    <label className="radioContainer">
                        {data.description}
                        <input type="radio" checked={data.status === 1} name="radio" />
                        <span className="checkmark"></span>
                    </label>
                </div>
            )
        })
    }

    return (
        <div className="container">
            <h1>To-do list</h1>
            {listItem()}
        </div>
    )
}

export default List;
